import vue from 'vue'
import Router from 'vue-router'
import Home from './components/Home.vue'
import login from './components/Login.vue'

vue.use(Router)

export default Router({
   routes:[
       {
         path:'/',
         component:Home,
         name:"Home"
       },
       {
         path:'/login',
         component:login,
         name:"login"
       }

   ]
})
